              "DISTANCE": 15,
              "CROSSPHASEADJUSTMENT": "10",
              "VARIANCE": 45,
              "DEVICES": [
                {
                  "ID": "ygqa3UlT46sdfDwac691",
                  "SIGNALSTRENGTHDISCREPANCY": "10",
                  "PRIMARY": []
                }
              ],
              "PATH": "1/4664/4660"
            },
            
            {
              "HANDLE": "4664",
              "PARENT": "",
              "DISTANCE": 25,
              "CROSSPHASEADJUSTMENT": "30",
              "VARIANCE": 25,
              "DEVICES": [
